-- SECTION 1: INSERT RECORDS --
-------------------------------
ACCEPT insertRecord CHAR PROMPT 'Do you want to insert sample records? (Y/N): '

DECLARE
    insertRecord char;
BEGIN
    -- Assigning user input to variable
    insertRecord := '&insertRecord';

    -- Enabling DBMS_OUTPUT package
    DBMS_OUTPUT.ENABLE;

    IF UPPER(insertRecord) != 'Y' THEN
        DBMS_OUTPUT.PUT_LINE('No records are inserted');
        DBMS_OUTPUT.PUT_LINE('Okay, Good Bye!');
        RAISE_APPLICATION_ERROR(-20000, 'User Exited');
    END IF;
END;
